import React, { Component } from "react";
import "./login.css";
import logo1 from '../images/logo1.svg';
import { Button, Form, Image } from "react-bootstrap";
import { Col, Container, Card } from "reactstrap";

class Login extends Component {
  render() {
    return (
      <Container>
        {/* <Button className="button" type="submit">ลงชื่อเข้าใช้</Button> */}
        {/* <div className="card card-border shadow my-5 mx-5 p-3 mb-2 bg-transbox"> */}
        <Card body inverse color="success" className="shadow my-5 mx-5 p-3 mb-2">
        <img className="displayed" src={logo1}/>
          <div className="card-body">
          {/* <Col md={2} className="col-4 mx-auto">
            <Image src={logo1}/>
          </Col> */}

            <form action="#">
              <Form.Group >
                <Form.Label>ชื่อผู้ใช้งาน</Form.Label>
                <Form.Control type="text" placeholder="เลขบัตรประชาชน" />
              </Form.Group>
              <Form.Group >
                <Form.Label>รหัสผ่าน</Form.Label>
                <Form.Control type="password" placeholder="Password" />
              </Form.Group>

              <Button className="mx-auto d-block btn-circle btn-xl" type="submit">ลงชื่อเข้าใช้</Button>
            </form>
            <br/>
            <p>footer</p>
          </div>
        </Card>
        {/* </div> */}
      </Container>
    );
  }
}
export default Login;
